import { Container, Navbar, Nav, Image } from "react-bootstrap";


function NavBar() {
    return (
        <Navbar bg="light" variant="light">
           <Container className="ml-5">
            <div>
                <Nav.Link className="ml-5" href="/">
                    <Image src="/fietslabyrint-logo.png" height="90" className="justify-content-start d-inline-block align-text-top ml-5" alt="logo" />
                </Nav.Link>
                </div>
            </Container>
        </Navbar>
    );
}


export default NavBar;
